import { useState, useEffect } from 'react';
import './App.css';

function VideoArray() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch("/videos")
      .then((res) => res.json())
      .then((data) => {
        let divs = [];
        data.array.forEach(element => {
          divs.push(
          <button key={element}>
            {element}
          </button>
          );
        });
        setData(divs);
      })
  }, []);

  console.log(data);

  return (
      <div>
        {!data ? "Loading..." : data}
      </div>
  );
}

function App() {

  return (
    <div className="App">
      <VideoArray />
    </div>
  );
}

export default App;
